<!DOCTYPE html>
<html lang="nb-NO">

<head>

  <title>Import av banktransaksjoner</title>
  <meta charset="UTF-8" />
  <meta http-equiv="X-UA-Compatible" content="IE=edge">
  <meta name="viewport" content="width=device-width, initial-scale=1.0">
  <link rel="stylesheet" href="styles/condo.css">

</head>

<body>

  <!-- All rows consist of 10 columns -->
  <div class="div-grid-importfile">
    <div class="div-menu"></div>
    <div class="div-importfile-importFileName"></div>
    <div class="div-importfile-columnLineNumber grid-column3"></div>
    <div class="div-importfile-columnAccountingDate grid-column4"></div>
    <div class="div-importfile-columnName grid-column5"></div>
    <div class="div-importfile-columnAccountName grid-column6"></div>
    <div class="div-importfile-columnFromBankAccount grid-column7"></div>
    <div class="div-importfile-columnToBankAccount grid-column8"></div>
    <div class="div-importfile-columnIncome grid-column9"></div>
    <div class="div-importfile-columnPayment grid-column10"></div>
    <div class="div-importfile-columnText grid-column11"></div>

    <div class="div-importfile-startImport"></div>

    <div class="div-importfile-saveBankAccountMovement"></div>
  </div>

  <script src="class/condo-class.js"></script>
  <script src="class/condo-user-class.js"></script>
  <script src="class/condo-condo-class.js"></script>
  <script src="class/condo-due-class.js"></script>
  <script src="class/condo-bankaccount-class.js"></script>
  <script src="class/condo-accounts-class.js"></script>
  <script src="class/condo-supplier-class.js"></script>
  <script src="class/condo-bankaccountmovement-class.js"></script>
  <script src="class/condo-importfile-class.js"></script>
  <script src="class/condo-condominium-class.js"></script>
  <script src="class/condo-userbankaccount-class.js"></script>
  <script src="scripts/condo-importfile.js"></script>
</body>

</html>
